window.bookSummaryJSON = "The invitation is signed \"Jaenelle Angelline\", and it summons her family to a special soirée. But when her guests enter the house, they find themselves trapped in a living nightmare created by the Black Widow witches - and if they try to use Craft as protection, they risk being sealed in the house forever. <p>But Jaenelle did not send the invitation. And now she and the rest of her family must rescue the others inside - and then find out who has created such a place, and why....</p>"; 
